INSERT INTO `code` VALUES (1,'1300.0120 subpart 1','SUBMIT PLANS AND OBTAIN APPROPRIATE PERMITS: Minneapolis Development Review, 250 S. 4th St., Room 300, Minneapolis, MN 55415, Phone: (612) 673-5800, Fax: (612) 370-1416, TTY: (612) 673-3300.  PROVIDE COPY OF PERMIT(S) OR EVIDENCE OF PLAN SUBMISSION TO THE'),(2,'1550.3200 Subp. 29','Post the UV lamp testing and bulb replacement record near the lamp assembly as required. MN rules 1550.3200 Subp. 29'),(3,'1550.3270','Operate and maintain all water vending machines in a sanitary manner, maintain adequate water quality monitoring, and take corrective actions necessary to assure safe and sanitary water is supplied to consumers. MN Rules 1550.3270'),(4,'1550.3280A','Post or display, in a position clearly visible to customers, the following information: (1) the operator?s name; (2) the operator?s address; (3) a statement describing the source of water and any treatment process including the names of any preservatives'),(5,'1550.3280B','Provide a recessed or guarded corrosion-resistant dispensing spout so constructed that neither the spout or guard contacts  the bottle MN Rules 1550.3280'),(6,'1550.3280C','Properly equip water vending machines with monitoring devices designed to shut down operation of the machine when the disinfection system fails to function MN Rules 1550.3280'),(7,'1550.3280D','Provide an approved self-closing, tight-fitting door on the vending compartment or other method of protecting the filler compartment MN Rules 1550.3280'),(8,'1550.3290 A','Maintain a record of cleaning and maintenance operations for each water vending machine and provide to the regulatory authority upon request. MN Rules 1550.3290'),(9,'1550.3290 B','Maintain records of required sampling and analysis on file for two years and be available for official review. MN Rules 1550.3290'),(10,'188.140','The presence of any food on the licensed premises is prima facie evidence of its intended sale. (99-Or-119, § 1, 10-29-99)'),(11,'188.150','The presence of utensils or equipment on the premises shall be prima facie evidence of their intended use. (99-Or-119, § 1, 10-29-99)'),(12,'188.160','It shall be unlawful for any person to conduct or operate a food establishment without obtaining a license thereof. The license issued under this chapter shall be known as a food license. No person shall engage in the business of selling food by vending m'),(13,'188.180','Any person desiring a food license shall file with the department of licenses and consumer services a written application to the city council for such license, giving in such application the full name, place, date of birth and address of the owner or prop'),(14,'188.250','\"The annual food license fees to be paid hereunder shall be as established in Appendix J, License Fee Schedule.\nMultiple Food Category Licenses: Establishments having a restaurant, grocery or food manufacturing license which also have other food category'),(15,'188.340','Each license granted under this chapter shall expire on April 1 of each year. (99-Or-119, § 1, 10-29-99)'),(16,'188.380','A hand washing lavatory shall be equipped to provide water to the user at a temperature of at least one hundred ten (110) degrees Fahrenheit (forty-three (43) degrees Celsius), but not more than one hundred thirty (130) degrees Fahrenheit (fifty-four (54)'),(17,'188.390','Each licensee shall keep his license prominently posted or readily available for inspection upon the premises. (99-Or-119, § 1, 10-29-99)'),(18,'188.440','In addition to ventilation requirements found in the Minnesota Food Code, ventilation hoods or canopies shall be installed over equipment where grease vapors, smoke, steam, odor, and heat are produced in the preparation of food. The ventilation systems sh'),(19,'188.450','Each food establishment shall provide water flush toilet facilities that are completely enclosed and which are connected to a sewerage system for use of its employees. Separate toilets must be furnished for each sex when five (5) or more employees of oppo'),(20,'188.580','\"(a) Summary closure conditions. The manager of environmental health may summarily close any licensed food establishment for the following reasons:\n(1) Any one of the following conditions exist on, or result from, the operation of the licensed premises:\na'),(21,'188.590','The services of a licensed pest control operator shall be required when a facility has evidence of rodent or insect activity to the extent that rodent droppings are visible, or live insects are seen during an inspection. The facility shall maintain record'),(22,'198.50','Each license shall be conspicuously posted on the licensed premises, and shall state the name of the licensee, the address of the licensed premises, and the date of the last inspection by the commissioner of health. (Code 1960, As Amend., § 714.050)'),(23,'2-101.11','Designate a person in charge and ensure that the person in charge is present in the establishment during all hours of operation. MN Rule 4626.0025'),(24,'2-102.11','The person in charge must adequately demonstrate knowledge of foodborne disease prevention, time and temperature control for potentially hazardous foods, safe food handling procedures, cleaning and sanitization procedures, plumbing cross connection contro'),(25,'2-103.11','The person in charge must ensure that employees and other persons comply with the rule.  MN Rule 4626.0035'),(26,'2-103.11B','The person in charge must ensure that persons unnecessary to the food establishment operation are not allowed in the food preparation, food storage, or warewashing areas, except that brief visits and tours may be authorized by the person in charge if step'),(27,'2-201.11A','The licensee must require food employees to report to the person-in- charge information about their health as it relates to foodborne illness.  Minnesota Rule 4626.0040'),(28,'2-201.11B','A food employee must report to the person in charge symptoms caused by illness, infection or other source that is: 1. associated with diarrhea, or vomiting, or other gastrointestinal illness, or 2. jaundice, or 3. a lesion containing puss such as a boil o'),(29,'2-201.15','The person in charge must notify the regulatory authority of any food employee or customer having, or suspected of having: 1. diarrhea or vomiting; 2. an enteric bacterial pathogen such as Salmonella spp, Shigella spp., or Escherichia coli 0157:h7; or 3.'),(30,'2-201.15A','The person-in-charge must notify the regulatory authority of any food employee or customer having, or suspected of having: 1. diarrhea or vomiting, 2. an enteric bacterial pathogen such as Salmonella spp., Shigella spp., or Escherichia coli 0157:H7, or 3.'),(31,'2-201.15B','The person-in-charge shall record all reports of diarrhea or vomiting made by food employees and report those illnesses to the regulatory authority at the specific request of the regulatory authority. Minnesota Rule 4626.0060'),(32,'2-201.15C','The person-in-charge shall notify the regulatory authority of any complaint from a customer having or suspected of having: (1) diarrhea or vomiting; (2) Salmonella spp., Shigella spp., Escherichia coli 0157:H7, or other enteric bacterial pathogen capable'),(33,'2-301.11','Food service employees must keep their hands and exposed parts of their arms clean to prevent contamination of food. MN Rule 4626.0065'),(34,'2-301.12','Food employees must wash their hands at the handwash sink in the food preparation area by vigorously rubbing together their soap-lathered hands and arms for at least twenty (20) seconds, scrubbing underneath the fingernails with a fingernail brush and rin'),(35,'2-301.14','Food employees must thoroughly wash their hands and exposed parts of their arms: 1. before beginning or returning to work; 2. after touching body parts other than clean hands and clean, exposed portions of arms, after defecating, after contacting body flu'),(36,'2-301.15','Use designated sink for handwashing.  Discontinue use of food preparation sinks, warewashing sinks, service sinks, or other non-handwashing sinks to wash hands.  MN Rule 4626.0080'),(37,'2-301.16A','Discontinue use of unapproved hand sanitizers. MN Rule 4626.0085'),(38,'2-302.11','Food employees must keep their fingernails trimmed, filed, free of nail polish, and maintained so the edges and surfaces are cleanable and not rough.  MN Rule 4626.0090'),(39,'2-303.11','Food employees must not wear jewelry on their arms and/or hands while preparing food, except for wedding bands. MN Rule 4626.0095'),(40,'2-304.11','Food handlers must wear clean outer clothing at all times while on duty.  MN Rule 4626.0100'),(41,'2-401.11','Discontinue consuming food, use of an unapproved beverage containers, or use of tobacco in any form in food preparation or utensil washing areas.  MN Rule 4626.0105'),(42,'2-402.11','All employees engaged in food preparation and/or utensil washing must wear effective hair restraints while on duty.  MN Rule 4626.0015'),(43,'259.135','Post and display the establishment\'s License Certificate on a wall in conspicuous place that\'s clearly visible to customers or the city investigators standing inside the doorway of the main office of the business. Minneapolis Ordinance 259.135.'),(44,'3-101.11','Remove all adulterated food from the premises immediately.  MN Rule 4626.0125'),(45,'3-201.11A','Remove all unapproved foods from the premises.  All food must be obtained from approved sources.  Minnesota Rule 4626.0130'),(46,'3-201.11B','Remove all home prepared or stored foods from the premises except as allowed by Minnesota Statutes 28A.15 and 157.22 clauses 6 and 7.  MN Rule 4626.0130'),(47,'3-201.12','Discontinue sale or service of food sealed in hermetically sealed containers that are not from food processing plants regulated by the food regulatory agency that has jurisdiction over the plant. Minnesota Rule 4626.0135'),(48,'3-201.16','Discontinue sale or service of wild mushrooms not from an approved source.  MN Rule 4626.0155'),(49,'3-202.11A','Discontinue sale or service of potentially hazardous foods not received at a temperature of 41 degrees F (5 degrees C) or below, or as otherwise specified by law.  MN Rule 4626.0165'),(50,'3-202.11C','Discontinue sale or service of potentially hazardous hot foods that were not properly cooked and are not received at a temperature of 140 degrees F (60 degrees C) or above.  MN Rule 4626.0165'),(51,'3-202.11E','Discard all potentially hazardous food which shows evidence of temperature abuse prior to receiving.  MN Rule 4626.0165'),(52,'3-202.16','Discard all food with damaged packaging.  MN Rule 4626.0190'),(53,'3-202.17','Discontinue use of ice not made from drinking water for use as food or as a cooling medium.  MN Rule 4626.0195'),(54,'3-202.19','Discontinue sale or service shellstock which are not obtained in containers bearing legible source identification tags or labels.  The harvester tags or labels must include the harvester\'s identification number, date of harvesting, the identification of t'),(55,'3-203.11A','Discontinue removing molluscan shellfish or shucked shellfish from their original container, other than for direct sale to consumer or preparation for service.  MN Rule 4626.0215'),(56,'3-203.12','A. Except as specified in item B, subitem (2), shellstock tags shall remain attached to the container in which the shellstock are received until the container is empty. B. The identity of the source of shellstock that are sold or served shall be maintaine'),(57,'3-203.12B','Discontinue using shellstock from one tagged or labeled container that are commingled from another container.  MN Rule 4626.0220'),(58,'3-301.11','Use spatulas, tongs, deli tissue, or other dispensing equipment to limit direct hand contact with food or ice.  MN Rule 4626.0225'),(59,'3-301.12','Discontinue using a utensil more than once to taste food that is to be sold or served.  MN Rule 4626.0230'),(60,'3-302.11A','Separate raw animal foods during storage, preparation, holding, and display from raw ready-to-eat foods or raw animal food and vegetables to prevent cross-contamination.  MN Rules 4626.0235'),(61,'3-302.11A4','Food shall be protected from cross-contamination by storing the food in packages, covered containers or wrappings.'),(62,'3-302.11B','Separate raw animal foods during storage, preparation, holding, and display from cooked ready-to-eat foods.  MN Rules 4626.0235'),(63,'3-302.12','Properly label all working containers holding food or food ingredients with the common name of the food.  MN Rule 4626.0240'),(64,'3-302.13','Discontinue use of unpasteurized eggs or egg products in the preparation of caesar salad, hollandaise or bearnaise sauce, mayonnaise, egg nog, ice cream, egg fortified beverages, and other foods that are not cooked as specified, or tom and jerry batter mi'),(65,'3-302.15A','Thoroughly wash in potable water all raw fruits and vegetables before cutting, combining with other ingredients, cooking, serving, or offering for human consumption in ready-to-eat form.  MN Rule 4626.0255'),(66,'3-303.11','Discontinue serving ice that has been used as a medium for cooling.  MN Rule 4626.0260'),(67,'3-303.12A','Do not store packaged food in direct contact with ice or water if the food is subject to the entry of water because of the nature of its packaging, wrapping, or container, or its positioning in the ice or water.  MN Rules 4626.0265'),(68,'3-303.12B','Discontinue storing bottled and canned beverages in water or undrained ice in the retail display.  MN Rule 4626.0265'),(69,'3-304.11B','Do not allow food to contact surface of equipment and utensils that are not cleaned and sanitized.  MN Rule 4626.0270'),(70,'3-304.12A','Store food preparation or dispensing utensils in the food with the handles above the top of the food within the container, in running water or sufficient velocity to flush particulates to the drain, or on a clean and sanitized portion of the food preparat'),(71,'3-304.12B','Store the consumer self-service bulk food dispensing utensil in the food with the handle extending out of the food, or in a protective enclosure attached or adjacent to the enclosure with the utensil on a tether of easily cleanable material which is short'),(72,'3-304.12C','Linens and napkins must not be used in contact with food unless they are used to line a container for the service of foods and the linens and napkins are replaced each time the container is refilled for a new consumer.  MN Rule 4626.0280'),(73,'3-304.13A','Use wiping cloths for a single purpose or activity only.  MN Rule 4626.0285'),(74,'3-304.13B','Store wiping cloths clean and dry or in an approved sanitizing solution.  MN Rule 4626.0285'),(75,'3-304.13B1','Provide and maintain an approved chlorine chemical sanitizer solution that has a minimum concentration of 50 ppm and a minimum temperature of 75 degrees F (24 degrees C) for water with a pH of eight or less or a minimum temperature of 100 degrees F (38 de'),(76,'3-304.13B2','Provide and maintain an approved quaternary ammonium compound sanitizing solution in water with 500 mg/L hardness or less, a minimum temperature of 75 degrees F (24 degrees C), and a concentration as specified on the manufacturer\'s label approved by the F'),(77,'3-304.13C','Store moist wiping cloths used with raw animal foods in separate sanitizing solution from cloths used for other purposes.  MN Rules 4626.0285'),(78,'3-304.14A','Single-use gloves must be used for only one task and be discarded when damaged or soiled, or when interruptions occur in the operation. MN Rule 4626.0287'),(79,'3-305.11','Store all food in a clean, dry location; where it is not exposed to splash, dust or other contamination; and at least six (6) inches above the floor.  MN Rule 4626.0300'),(80,'3-305.12','Do not store food in locker rooms, toilet rooms, dressing rooms, garbage rooms, mechanical rooms, under unprotected sewer lines, under leaking water lines, under water lines on which water has condensed, under open stairwells, or under other sources of co'),(81,'3-305.14','Protect unpackaged food from environmental sources of contamination during preparation.  MN Rule 4626.0315'),(82,'3-306.11','Food Display. Protect food from contamination by using packaging; counter, service line, or salad bar food guards; display cases; or other effective means.  MN Rule 4626.0320'),(83,'3-306.13B','Provide suitable utensils or effective dispensing methods that protect the food from contamination at consumer self-service operations of ready-to-eat foods.  MN Rule 4626.0330'),(84,'3-306.14','Discard unwrapped or potentially hazardous food after it has been served once.  Non-potentially hazardous food that is still packaged and in sound condition may be re-served.  MN Rule 4626.0335'),(85,'3-401.11','Raw animal foods, including eggs, fish, poultry, meat, and foods containing these raw animal foods, shall be cooked to heat all parts of the food to a temperature and for a time that complies with MN Rule 4626.0340 3-401.11 RAW ANIMAL FOODS, Items A and B'),(86,'3-401.11A1B','Cook fish and meat to 145 degrees F (63 degrees C) or above for 15 seconds.  MN Rule 4626.0340'),(87,'3-401.11A2','Cook pork, exotic species, game animals, comminuted fish and meats, injected meats, and eggs for hot holding to or above 155°F (68°C) for fifteen seconds or 150°F (63°C) for one minute, or 145°F (66°C) for three minutes. MN Rule 4626.0340'),(88,'3-401.11C','Apply for a variance when deviating from cooking temperatures for raw animal foods, including eggs, fish, poultry, meat and foods containing these raw animal foods. MN Rule 4626.0340'),(89,'3-401.15','Cook raw animal foods properly in the microwave oven to 165°F (74°C) and allow to stand covered for two minutes after cooking.  Minnesota Rule 4626.0345'),(90,'3-402.11','Freeze ready-to-eat raw, marinated, or partially cooked fish, with the exception of molluscan shellfish, to -4 degrees F (-20 degrees C or below for 168 hours (7 days) in the freezer or -31 degrees F (-35 degrees C) or below for 15 hours in a blast freeze'),(91,'3-402.12A','Provide and maintain for 90 days beyond the sale or service of the ready-to-eat raw, marinated or partially cooked fish, records of the freezing temperatures and time to which the fish are subjected.  MN Rule 4626.0355'),(92,'3-402.12B','Provide a written agreement or statement from the supplier stipulating that the fish are frozen to a temperature and for a time as required by rule.  MN Rule 4626.0355'),(93,'3-403.11','Reheat previously cooked refrigerated potentially hazardous food for hot holding within 2 hours to a temperature of at least 165 degrees F (74 degrees C) for 15 seconds.  MN Rule 4626.0360'),(94,'3-403.11B','Reheat previously cooked refrigerated potentially hazardous foods in the microwave to an internal temperature of 165 degrees F (74 degrees C) and let stand covered for two minutes after heating.  MN Rule 4626.0360'),(95,'3-501.11','Maintain all stored frozen foods in a frozen state at all times.  MN Rule 4626.0370'),(96,'3-501.12','Immediately maintain all potentially hazardous food that has been slacked to moderate the temperature at 41 degrees F (5 degrees C) or less under mechanical refrigeration or at any temperature if the food remains frozen.  MN Rule 4626.0375'),(97,'3-501.13','Do not thaw potentially hazardous foods at room temperature.  Thaw by one of the following methods to prevent microbial growth in the food:1. Under refrigeration that maintains the food temperature at 41 degrees F (5 degrees C) or below;2. Completely subm'),(98,'3-501.14A','Cool cooked potentially hazardous food:1. From 140 degrees F (60 degrees C) to 70 degrees F (21 degrees C) within two hours; and 2. From 70 degrees F (21 degrees C) to 41 degrees F (5 degrees C) or below, within four hours to prevent microbial growth in t'),(99,'3-501.14B','Cool potentially hazardous food prepared from ingredients at ambient temperature to 41 degrees F (5 degrees C) or below within four hours to prevent microbial growth in the food.  MN Rule 4626.0385'),(100,'3-501.15','Cool potentially hazardous food by: 1. placing the food in loosely covered shallow pans; 2. separating the food into smaller or thinner portions; 3. using rapid cooling equipment; 4. food agitation in an ice bath; 5. using containers that facilitate heat'),(101,'3-501.16A','Maintain all hot, potentially hazardous foods at 140 degrees F (60 degrees C) or above to prevent bacterial growth and/or toxin production except roast beef may be held at 130 degrees F (54 degrees C) if cooked in accordance with specified time and temper'),(102,'3-501.16B','Maintain all cold, potentially hazardous foods at 41 degrees F (5 degrees C) or below under mechanical refrigeration, to prevent bacterial growth and/or toxin production.  MN Rule 4626.0395'),(103,'3-501.17A','Mark date of preparation on all refrigerated, ready-to-eat potentially hazardous food prepared in the food establishment and held for more than 24 hours.  This will help ensure the food is consumed by the \"Use-by\" date, which is 7 days from the date of pr'),(104,'3-501.17B','Date mark potentially hazardous food that is prepared in a food establishment and which is subsequently frozen:  1.  when the food is thawed to indicate that the food must be consumed within 24 hours; or  2.  when the food is placed in the freezer to indi'),(105,'3-501.17C','Date mark all refrigerated, ready-to-eat, potentially hazardous food prepared and packaged by a food processing plant, to prevent food from being used after seven calendar days after the container is opened, including the day of opening.  MN Rule 4626.040'),(106,'3-501.17D','Date mark all refrigerated, ready-to-eat, potentially hazardous food prepared and packaged by a food processing plant and subsequently opened and frozen in a food establishment: 1. when the food is thawed to indicate that the food must be consumed within'),(107,'3-501.18A','Discard all refrigerated, ready-to-eat, potentially hazardous food prepared in the establishment which has not been consumed within 7 calendar days from the date of preparation.  MN Rule 4626.0405'),(108,'3-501.18C','Discard all refrigerated, ready-to-eat, potentially hazardous food prepared and packaged by a food processng plant which has not been consumed within 7 calendar days after the original package has been opened.  Mn Rule 4626.0405'),(109,'3-501.19 subp 2','Notification.  The food establishment must submit written notification to the regulatory authority of its intention to use the procedures provided under this part prior to implementing the provisions of this part. Mn Rule 4626.0410'),(110,'3-501.19A','When using time as a public health control, mark or otherwise identify all potentially hazardous food with the time within which the food is to be cooked, served, or discarded to help prevent food which has been held at unsafe temperatures for too long fr'),(111,'3-501.19B','Discard all potentially hazardous food which has been removed from temperature control for over 4 hour because the food may contain unsafe numbers of pathogens.  MN Rule 4626.0410'),(112,'3-501.19C','When using time as a public health control, discard all potentially hazardous food in unmarked containers or packages and all potentially hazardous food for which the time has expired to ensure that food which may contain unsafe numbers of pathogens is no'),(113,'3-501.19D','When using time as a public health control, written procedures must be provided and maintained in the establishment to ensure that: 1. Potentially hazardous food is marked or otherwise identified with the time within which it must be cooked, served, or di'),(114,'3-502.11','Prepare a HACCP plan before:1. smoking or curing food, except for imparting flavor only and not as part of the cooking process; or 2. using food additives or components, including vinegar to preserve food or render a food so it is not potentially hazardou'),(115,'3-502.12B1','Identify the food to be packaged using ROP. MN Rule 4626.0420'),(116,'3-502.12C','A food establishment must not package fish using a reduced oxygen method, except for fish that is frozen before, during, and after packaging.  MN Rule 4626.0420'),(117,'3-601.12A','Discontinue misrepresenting food in any way.  MN Rule 4626.0430'),(118,'3-602.11','Label all packaged food for sale in the establishment  as specified in 3-602.11.  MN Rule 4626.0435'),(119,'3-602.12A','If required, provide consumer information, including nutritional information, and  consumer warnings.  MN Rule 4626.0440'),(120,'3-602.12B','Discontinue concealing or altering dating information on foods.  MN Rule 4626.0440'),(121,'3-602.12C','Properly label self-service bulk food dispensers as follows: 1. the manufacturer or processor label provided with the food, including nutritional labeling; or 2. a card, sigh, placard, or other notification method that includes the common or usual name of'),(122,'3-701.11','Discard all food that is adulterated, misbranded, or not from an approved source to prevent contaminated food from being served.  MN Rule 4626.0445'),(123,'4-101.111','Remove non-food-contact surfaces that are not corrosion-resistant, non-absorbent, smooth, and easy to clean. MN Rule 4626.0495'),(124,'4-101.11A','Remove all unsafe multi-use equipment, utensils, and food storage containers that impart color, odors, or tastes to food.  MN Rule 4626.0450'),(125,'4-101.11B','Remove all multi-use equipment, utensils, and food storage containers that are not durable, corrosion-resistant, and nonabsorbent.  MN Rule 4626.0450'),(126,'4-101.11C','Remove all multi-use equipment, utensils, and food storage containers that cannot withstand repeated warewashing.  MN Rule 4626.0450'),(127,'4-101.11D','Provide multi-use equipment, utensils, and food storage containers that are smooth, easily cleanable and resistant to pitting, chipping, or scratching.  MN Rule 4626.0450'),(128,'4-101.16','Discontinue using sponges in contact with cleaned and sanitized or in-use food-contact surfaces.  MN Rule 4626.0475'),(129,'4-101.19','Discontinue using, except as provided in rule, wood as a food contact surface.  MN Rule 4626.0490'),(130,'4-102.11A','Remove single service and single use articles made from deleterious or unsafe material. MN Rule 4626.0500'),(131,'4-102.11B','Remove single service and single use articles made from materials which impart colors, odors, or tastes to food or are unclean.  MN Rule 4626.0500'),(132,'4-201.11A','Replace equipment or utensils that are not durable under normal use conditions.  MN Rule 4626.0505'),(133,'4-201.11B','Provide or replace food service equipment to meet NSF International Standards.  MN Rule 4626.0505'),(134,'4-201.11C','Provide vending machines used to dispense food or water that meet NSF International or NAMA standards.  MN Rule 4626.0505'),(135,'4-201.11E','Provide or replace bakery equipment to meet BISSC or NSF International Standards.  MN Rule 4626.0505'),(136,'4-202.11','Discontinue use of multi-use food-contact surfaces that are not smooth, free of breaks, open seams, cracks, chips, pits, and other imperfections and that are not accessible for cleaning or inspection.  MN Rule 4626.0515'),(137,'4-202.15','Remove can openers that have cutting and piercing parts that are not readily removable.  MN Rule 4626.0540'),(138,'4-202.16','Provide non-food contact surfaces that are free of unnecessary ledges, projections, and crevices and are designed to be easily removed for cleaning and inspection.  MN Rule 4626.0540'),(139,'4-202.18','Provide approved filters for the exhaust hood.  MN Rule 4626.0550'),(140,'4-203.11','Replace food measuring thermometers that are not accurate to plus or minus 2 degrees F.  MN Rule 4626.0555'),(141,'4-203.12','Replace ambient air and water temperature measuring devices that are not accurate to plus or minus 3 degrees F.  MN Rule 4626.0560'),(142,'4-203.13','Replace the Pressure gauge on the dishwasher with one that is accurate to 2 PSI in the 15 to 25 PSI range.  MN Rule 4626.0563'),(143,'4-204.11','Prevent grease or condensation from exhaust ventilation hood systems from draining or dripping onto food, equipment, utensils, linens, single-service and single-use articles.  MN Rule 4626.0565'),(144,'4-204.110B','Provide a display only sign on the Molluscan shellfish tanks if the shellfish are not for human consumption. MN Rule 4626.0610'),(145,'4-204.112A','Provide a temperature measuring device located in the warmest part of mechanically refrigerated units and in the coolest part of hot food storage units.  MN Rule 4626.0620'),(146,'4-204.112E','Provide food and water temperature measuring devices that are numerically scaled in increments no greater than 2 degrees F.  MN Rule 4626.0620'),(147,'4-204.115','Provide a temperature measuring device in the warewashing machine that indicates the temperature of the water in the wash tank, rinse tank, and the water that enters the sanitizing final rinse manifold or the sanitizing solution tank.  MN Rule 4626.0635'),(148,'4-204.116A','Provide and use an approved integral heating device that is capable of maintaining the water at a temperature not less than 171 degrees F (77 degrees C).  MN Rule 4626.0640'),(149,'4-204.16','Provide cold plates that are integrally constructed with an ice storage bin.  MN Rule 4626.0590'),(150,'4-301.11','Provide adequate mechanical refrigeration or hot holding devices to maintain potentially hazardous foods at proper temperatures.  MN Rule 4626.0675'),(151,'4-301.12','Provide a three compartment sink large enough to accommodate immersion of the largest equipment and utensils, that is equipped with an integrally mounted drainboard at each end.  MN Rule 4626.0680'),(152,'4-301.13A','Provide integral drainboards, utensil racks, or tables large enough to accommodate all soiled and clean items.  MN Rule 4626.0685'),(153,'4-301.14','Ventilation hood systems and devices shall be sufficient in number and capacity to prevent grease or condensation from collecting on walls and ceilings.'),(154,'4-301.15','Provide and use a mechanical clothes washer and dryer for any on premise laundering of work cloths and linens.  MN Rule 4626.0695'),(155,'4-302.12','Provide a readily accessible food temperature measuring device.  MN Rule 4626.0705'),(156,'4-302.14','Provide an appropriate test kit to accurately measure sanitizer concentration.  MN Rule 4626.0715'),(157,'4-402.11A','Space fixed equipment to allow access for cleaning along the sides of, behind and above the unit, or seal to adjoining equipment or walls.  MN Rule 4626.0725'),(158,'4-402.11B','Install table mounted equipment to allow cleaning underneath and around equipment.  MN Rule 4626.0725'),(159,'4-402.11C','Secure carbon dioxide and bottle gas cylinders with chains or other restraints.  MN Rule 4626.0725'),(160,'4-402.12A','Install floor mounted equipment sealed to the floor or elevated on six inch legs except for display units, if the floor under units is maintained clean.  MN Rule 4626.0730'),(161,'4-501.110A','Provide proper wash water temperature for the warewashing machine as specified in code and the manufacturer\'s data plate.  MN Rule 4626.0785'),(162,'4-501.112','Maintain the temperature at the manifold of the hot water sanitizing rinse between 194 degrees F (90 degrees C) and 165 degrees F (74 degrees C) for a single tank, stationary rack, single temperature machine, or 180 degrees F (82 degrees C) for all other'),(163,'4-501.114C1','Provide and maintain an approved chlorine chemical sanitizer solution that has a minimum concentration of 50 ppm and a minimum temperature of 75 degrees F (24 degrees C) for water with a pH of eight or less or a minimum temperature of 100 degrees F (38 de'),(164,'4-501.114C2','Provide and maintain an approved iodine chemical sanitizing solution that has a minimum temperature of 75 degrees F (24 degrees C) and a pH of 5.0 or less (unless manufacturer\'s label specified a higher pH 