naces, gas, or oil-fired room heaters, and water heaters according to Minnesota Rules Chapters 1305, 1346, and 7510.  MN Rule 4626.1475'),(286,'6-304.11C','Operate the ventilation system when ventilated equipment is in use.  MN Rule 4626.1475'),(287,'6-304.11D','Discontinue operating the ventilation system with the filters removed.  MN Rule 4626.1475'),(288,'6-305.11B','Provide lockers or other suitable facilities for the orderly storage of employees\' clothing and other possessions.  MN Rule 4626.1480'),(289,'6-403.11B','Locate employee lockers in areas so that food, equipment, utensils, linens, and single-service and single-use articles are protected from contamination.  MN Rule 4626.1500'),(290,'6-404.11','Segregate products that are held for credit, redemption, or return in a designated area that is separate from food, utensils, linens, and single-service and single-use articles.  MN Rule 4626.1505'),(291,'6-501.11','Maintain the physical facilities in good repair.  MN Rule 4626.1515'),(292,'6-501.110B','Use the lockers or other suitable facilities to store clothing and other possessions.  MN Rule 4626.1560'),(293,'6-501.111ABD','Provide control of insects, rodents, and other pests by routinely inspecting incoming food and supply shipments, routinely inspecting the premises for evidence of pests, and eliminating harborage conditions.  MN Rule 4626.1565'),(294,'6-501.111C','Use approved trapping devices or other means of pest control when pests are found.  MN Rule 4626.1565'),(295,'6-501.112','Remove dead or trapped birds, insects, rodents, and other pests from the premises.  MN Rule 4626.1570'),(296,'6-501.113A','Store maintenance tools such as mops, brooms, vacuum cleaners, and similar equipment so they do not contaminate food, equipment, utensils, linens, and single-service and single-use articles.  MN Rule 4626.1575'),(297,'6-501.113B','Store maintenance and cleaning equipment in an orderly manner that facilitates the cleaning of the storage area.  MN Rule 4626.1575'),(298,'6-501.114','Remove all unnecessary articles and litter from the premises which are not pertinent to the current operation of the food establishment.  MN Rule 4626.1580'),(299,'6-501.115AB','Remove all live animals from the establishment except as specified in rule.  MN Rule 4626.1585'),(300,'6-501.12A','Clean and maintain clean all physical facilities.  MN Rule 4626.1520'),(301,'6-501.14A','Maintain clean all intake, exhaust and air ducts and change filters so they are not a source of contamination.  MN Rule 4626.1530'),(302,'6-501.14B','Maintain outside ventilation systems so that they do not create a public health hazard or unlawful discharge.  MN Rule 4626.1530'),(303,'6-501.15','Discontinue cleaning maintenance tools, preparing or holding maintenance materials, discarding mop water or similar waste in food preparation sinks, handwashing lavatories, or warewashing equipment.  MN Rule 4626.1535'),(304,'6-501.16','Hang mops to dry after each use and do not store mops in a manner that will soil walls, equipment, or supplies.  MN Rule 4626.1540'),(305,'6-501.18','Clean and maintain the handwashing sinks.  MN Rule 4626.1550'),(306,'6-501.19','Keep the toilet room doors closed except during cleaning and maintenance operations.  MN Rule 4626.1555'),(307,'601','Obtain and secure appropriate permits for any and all proposed changes to facility (new construction, remodeling, expansion, etc.) prior to making such changes or provide copy of permit(s) or evidence of plan submission. MN Rule 1300.0120'),(308,'602','Prohibit smoking inside the establishment and post \"No Smoking\" signs that comply with the Minnesota Clean Indoor Air Act Rules at main entrances of the establishment. Minneapolis Ordinance 234.'),(309,'7-102.11','Clearly label with the common name of the product, all spray bottles and other working containers containing cleaners, sanitizers, and other poisonous or toxic materials taken from bulk supplies.  MN Rule 4626.1595'),(310,'7-201.11A','Separate poisonous or toxic materials from food, equipment, utensils, linens, and single-service and single use articles by spacing or partitioning.  MN Rule 4626.1600'),(311,'7-201.11B','Discontinue storing poisonous or toxic materials above food, equipment, utensils, linens, or single service or single-use articles.  MN Rule 4626.1600'),(312,'7-202.11','Remove from the premises all poisonous or toxic materials not immediately necessary for the maintenance of the establishment, the cleaning or sanitization of equipment or utensils, or the control of insects or rodents.  MN Rule 4626.1605'),(313,'7-202.12A','Use poisonous or toxic materials according to label directions and MN Statutes Chapter 18B and section 31.101, subdivision 3.  MN Rule 4626.1610'),(314,'7-202.12C','Apply restricted use pesticides by using applicators certified as specified in the Federal Insecticide, Fungicide, and Rodenticide Act, United States Code, Title 7, Section 136, paragraph (e), and Minnesota Statutes, Chapter 18B.  MN Rule 4626.1610'),(315,'7-204.11','Discontinue using chemical sanitizers and other chemical antimicrobials on food contact surfaces that do not meet the requirement specified in 21 CFR 178.1010.  MN Rule 4626.1620'),(316,'7-206.12','Contain rodent bait in a covered, tamper resistant bait station.  MN Rule 4626.1650'),(317,'7-207.11A','Remove from the premises all medicines that are not necessary for the health of the employees.  MN Rule 4626.1660'),(318,'7-207.11B','Locate personal medications in areas that do not contaminate food, equipment, utensils, linens, and single-service and single use articles.  MN Rule 4626.1660'),(319,'7-208.11','Store first aid supplies in a kit or container that will prevent contamination of food, equipment, utensils, linens, and single-service and single-use articles.  MN Rule 4626.1670'),(320,'7-209.11','Except as specified in parts 4626.1665 and 4626.1670, employees shall store personal care items as specified in part 4626.1560, item B. MN Rule 4626.1675'),(321,'7-301.11A','Separate from food, equipment, utensils, linens, and single-service and single-use articles by spacing or partitioning all stored and displayed poisonous or toxic materials intended for retail sale.  MN Rule 4626.1680'),(322,'7-301.11B','Locate poisonous and toxic materials for retail sale in areas that are not above food, equipment, utensils, linens, and single-service and single-use articles.  MN Rule 4626.1680'),(323,'8-103.12B','Comply with the HACCP plan and procedures submitted and approved as part of the granted variance and maintain records as specified in the rule.  MN Rule 4626.1700'),(324,'8-201.11A','Submit complete plans and specifications to the regulatory authority for review and approval at least 30 days prior to beginning any new construction, conversion, change of type of food establishment or food operation, or extensive remodeling of a food es'),(325,'8-201.11E','Change plans and specifications that are not approved, to comply with rules or delete from the project.  MN Rule 4626.1720'),(326,'8-201.12','Include in plans and specifications submitted for approval to the regulatory authority the following:1. intended menu;2. anticipated volume of food to be stored, prepared, and sold or served;3. proposed layout, mechanical schematics, construction material'),(327,'8-201.13 Subp. 1','Submit a HACCP plan for the following activities: 1. serving raw animal foods that are offered in a ready-to-eat form; 2. specialized processing; 3. operating and maintaining molluscan shellfish tanks; 4. removing tags or labels from shell stock; and5. re'),(328,'8-301.11','Discontinue operating the food establishment until a license to operate is obtained from the regulatory authority.  MN Rule 4626.1765'),(329,'8-501.02','The following area(s), equipment and utensils are under embargo and may not be used without authorization of the regulatory authority.  MN Rule 4626.1805B'),(330,'8-501.03','The following items are condemned and shall be removed from the establishment immediately.  MN Rule 4626.1810'),(331,'8-501.05','Comply with the provisions of the Minnesota Clean Indoor Air Act, MN Statutes sections 144.411 to 144.417 and rules.  MN Rule 4626.1820a'),(332,'8-501.11','Post in the food preparation area visible to all employees an approved chart illustrating an approved emergency first aid procedure for choking.  MN Rule 4626.1825'),(333,'HACCP Compliance Order','See HACCP Ongoing Review inspection report.');
